func Test_getFileBytes(t *testing.T) {
	type args struct {
		file *os.File
	}
	f, _ := os.OpenFile("generate_protobuf.sh", os.O_RDONLY, 643)
	test1 := args{f}
	tests := []struct {
		name string
		args args
		want []byte
	}{
		{
			"test to verify if file is getting converted to bytes",
			test1,
			[]byte{112, 114, 111, 116, 111, 99, 32, 45, 45, 103, 111, 95, 111, 117, 116, 61, 46, 32, 45, 45, 103, 111, 95, 111, 112, 116, 61, 112, 97, 116, 104, 115, 61, 115, 111, 117, 114, 99, 101, 95, 114, 101, 108, 97, 116, 105, 118, 101, 32, 45, 45, 103, 111, 45, 103, 114, 112, 99, 95, 111, 117, 116, 61, 46, 32, 45, 45, 103, 111, 45, 103, 114, 112, 99, 95, 111, 112, 116, 61, 112, 97, 116, 104, 115, 61, 115, 111, 117, 114, 99, 101, 95, 114, 101, 108, 97, 116, 105, 118, 101, 32, 66, 111, 116, 83, 101, 114, 118, 105, 99, 101, 46, 112, 114, 111, 116, 111},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := getFileBytes(tt.args.file); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("getFileBytes() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_getMetaData(t *testing.T) {
	type args struct {
		info os.FileInfo
	}
	f, _ := os.OpenFile("generate_protobuf.sh", os.O_RDONLY, 643)
	fInfo, _ := f.Stat()
	test1 := args{fInfo}
	tests := []struct {
		name string
		args args
		want *MetaData
	}{
		{
			"test to see if metadata struct is correct",
			test1,
			&MetaData{FileName: "generate_protobuf.sh", Size: 117, Lastmodified: "2021-09-19 07:06:32.255420779 +0530 IST"},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := getMetaData(tt.args.info); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("getMetaData() = %v, want %v", got, tt.want)
			}
		})
	}
}

func TestIsError(t *testing.T) {
	type args struct {
		err error
	}
	err1 := errors.New("this is an error")
	test1 := args{err1}
	test2 := args{}
	tests := []struct {
		name string
		args args
		want bool
	}{
		{
			"test to check when error is triggered",
			test1,
			false,
		},
		{
			"test to check when error is nil",
			test2,
			true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := IsError(tt.args.err); got != tt.want {
				t.Errorf("IsError() = %v, want %v", got, tt.want)
			}
		})
	}
}

