func TestIsValidImageType(t *testing.T) {
	type args struct {
		fileName string
	}
	a := args{"test.png"}
	b := args{"test.jpg"}
	c := args{"test.gif"}
	d := args{"test.jpeg"}
	tests := []struct {
		name string
		args args
		want bool
	}{
		{
			"test for png file",
			a,
			true,
		},
		{
			"test for jpg file",
			b,
			true,
		},
		{
			"test for gif file",
			c,
			true,
		},
		{
			"test for no extension on file type",
			d,
			false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := IsValidImageType(tt.args.fileName); got != tt.want {
				t.Errorf("IsValidImageType() = %v, want %v", got, tt.want)
			}
		})
	}
}
